class Solution {
  int incremovableSubarrayCount(List<int> nums) {
    int total = 0, n = nums.length;
    List<int> dp = List.filled(n, 0);
    dp[n - 1] = 1; // Last element forms a strictly increasing subarray of length 1.
    for (int i = n - 2; i >= 0; i--) {
      if (nums[i] < nums[i + 1]) {
        dp[i] = dp[i + 1] + 1;
      } else {
        dp[i] = 1;
      }
    }
    for (int len = 1; len <= n; len++) {
      for (int i = 0; i + len - 1 < n; i++) {
        int j = i + len - 1;
        if ((i == 0 || nums[i - 1] < nums[i]) && (j == n - 1 || nums[j] < nums[j + 1]) && (len == 1 || dp[i + 1] >= len - 1)) {
          total++;
        }
      }
    }
    return total;
  }
}
